INSERT INTO `v1_2dd47f844beae5917f70b6ed91028e5540fc3114127f77014d29c9f73e808aaa` VALUES ("2030/12/17 14:59:59", "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", "2019/07/31 12:00:00", 10021, 24015, 4, 110501, 0.0, 4, 0.0, "カオリ（サマー）", 24, 1, 0.0);
INSERT INTO `v1_2dd47f844beae5917f70b6ed91028e5540fc3114127f77014d29c9f73e808aaa` VALUES ("2030/12/17 14:59:59", "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", "2019/07/31 12:00:00", 10021, 24016, 1, 110501, 0.0, 4, 4.0, "カオリ（サマー）", 24, 2, 0.0);
INSERT INTO `v1_2dd47f844beae5917f70b6ed91028e5540fc3114127f77014d29c9f73e808aaa` VALUES ("2030/12/17 14:59:59", "マジムンだらけで目が回るさ～！\nふらふらさ～！", "2019/07/31 12:00:00", 10021, 24017, 4, 110501, 0.0, 4, 0.0, "カオリ（サマー）", 24, 3, 0.0);
INSERT INTO `v1_2dd47f844beae5917f70b6ed91028e5540fc3114127f77014d29c9f73e808aaa` VALUES ("2030/12/17 14:59:59", "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", "2019/07/31 12:00:00", 10021, 24018, 2, 110501, 0.0, 1, 5.2, "カオリ（サマー）", 24, 4, 0.0);
INSERT INTO `v1_2dd47f844beae5917f70b6ed91028e5540fc3114127f77014d29c9f73e808aaa` VALUES ("2030/12/17 14:59:59", "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", "2019/07/31 12:00:00", 10021, 24019, 6, 110501, 0.0, 5, 4.2, "カオリ（サマー）", 24, 5, 0.0);
INSERT INTO `v1_2dd47f844beae5917f70b6ed91028e5540fc3114127f77014d29c9f73e808aaa` VALUES ("2030/12/17 14:59:59", "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", "2019/07/31 12:00:00", 10021, 24020, 2, 110501, 0.0, 2, 0.0, "カオリ（サマー）", 24, 6, 0.0);
INSERT INTO `v1_2dd47f844beae5917f70b6ed91028e5540fc3114127f77014d29c9f73e808aaa` VALUES ("2030/12/17 14:59:59", "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", "2019/07/31 12:00:00", 10021, 24021, 6, 110501, 0.0, 1, 6.4, "カオリ（サマー）", 24, 7, 0.0);
INSERT INTO `v1_2dd47f844beae5917f70b6ed91028e5540fc3114127f77014d29c9f73e808aaa` VALUES ("2030/12/17 14:59:59", "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", "2019/07/31 12:00:00", 10021, 24022, 2, 110501, 0.0, 2, 0.0, "カオリ（サマー）", 24, 8, 0.0);
INSERT INTO `v1_2dd47f844beae5917f70b6ed91028e5540fc3114127f77014d29c9f73e808aaa` VALUES ("2030/12/17 14:59:59", "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", "2019/07/31 12:00:00", 10021, 24023, 3, 110501, 0.0, 6, 10.08, "カオリ（サマー）", 24, 9, 0.0);
INSERT INTO `v1_2dd47f844beae5917f70b6ed91028e5540fc3114127f77014d29c9f73e808aaa` VALUES ("2030/12/17 14:59:59", "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", "2019/07/31 12:00:00", 10021, 24024, 2, 110501, 0.0, 1, 5.0, "カオリ（サマー）", 24, 10, 0.0);
INSERT INTO `v1_2dd47f844beae5917f70b6ed91028e5540fc3114127f77014d29c9f73e808aaa` VALUES ("2030/12/17 14:59:59", "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", "2019/07/31 12:00:00", 10021, 24025, 2, 110501, 0.0, 2, 0.0, "カオリ（サマー）", 24, 11, 0.0);
